import React from 'react';

const FilterExpense = () => {
    return (  
        <>
            <div className="expenses-filter">
                <div className="expenses-filter__control">
                    <h1>Filter expense here</h1>
                </div>
            </div>
        </>
    );
}

export default FilterExpense;
